# Adicionar Exame

- Cadastra um novo Exame

---

### Entrada

```json
{
  "name": "Raio X - Torax",
  "typeExam" : "imagem"
}
```

---

### Sucesso

`status code - 200`

---

### Exception

`status code - 422`

```json
{
  "errors": [
    {
      "rule": "required",
      "field": "name",
      "message": "required validation failed"
    },
    {
      "rule": "required",
      "field": "typeExam",
      "message": "required validation failed"
    },
    {
      "rule": "enum",
      "field": "typeExam",
      "message": "enum validation failed",
      "args": {
        "choices": [
          "analise_clinica",
          "imagem"
        ]
      }
    }
  ]
}
```

# Atualizar Exame

- Atualiza um exame Existem

---

### Entrada

- Passar o id do exame na rota

```json
{
  "name": "Raio X - Torax",
  "typeExam" : "imagem"
}
```

---

### Sucesso

`status code - 200`

---

### Exception

`status code - 422`

```json
{
  "errors": [
    {
      "rule": "required",
      "field": "name",
      "message": "required validation failed"
    },
    {
      "rule": "required",
      "field": "typeExam",
      "message": "required validation failed"
    },
    {
      "rule": "enum",
      "field": "typeExam",
      "message": "enum validation failed",
      "args": {
        "choices": [
          "analise_clinica",
          "imagem"
        ]
      }
    }
  ]
}
```

`status code - 404`

```json
{
  "message": "examination is not found"
}
```

